import React from "react";
import logo from "../../../../assets/image/logo.png";
import ServerList from "./ServerList";
class HomeIcon extends React.Component {
    render() {
        return (
            <>
                <img src={logo} alt="logo" />
                <ServerList />
            </>
        );
    }
}

export default HomeIcon;
